		{
			"_addr": "26ADEA70",
			"always_active": "yes",
			"current_frame": "normal",
			"custom": "yes",
			"face_right": 0,
			"hitpoints": 20000,
			"label": "bossy plant",
			"max_hitpoints": 2,
			"on_end_stand_anim": "if(phase != 'fight', swallow_event(), animation('shoot'))",
			"on_frog_arrival": "if(distance(self, level.player) > 200, 
		[set(level.player.control_lock, ['ctrl_right']), 
		schedule(3, fire_event('frog_arrival'))], 
		[set(level.player.control_lock, []), 
		set(level.zoom, 2),
		speech_dialog(
			#Introduction.#
			clixx,		['Hello there, person behind me.'],
			
			frogatto,	['Hi. I`m Frogatto!'],
			
			clixx, 		['Hello, Fragotto.'],
						['I`m having a touch of trouble here...
						This plant is stuck in the ground, it has taken root.
						I guess I should count my blessings, though. At least
						it`s not trying to shoot me.'],
						
			frogatto,	['In my limited experience with these things, that
						means it`s charging up.'],
						
			plant,		animation('shoot'),
						schedule(45, fire_event('shoot')),
						schedule(50, fire_event('shoot')),
						
			frogatto, 	schedule(60, set(level.player.control_lock, ['ctrl_right'])), 
						schedule(70, set(level.player.control_lock, [])), 
						
			clixx, 		schedule(62, set(clixx.facing, -clixx.facing)),
						schedule(75, set(clixx.facing, clixx.facing)),
						
			plant, 		['*gurgle*'],
						
			clix,		['Uh...'],
						
			frogatto, 	['If you don`t mind, I`ll just be leaving now.'],
			
			clixx,		['Could you just keep an eye on the plant? From a
						safe distance? I`m afraid to leave it, I think it
						might get up and walk away.'],
						
			frogatto, 	['... oh, fine.'],
			
			clixx, 		['Thanks, Fragotto! I`ll be right back!'],
						schedule(5, [set(clixx.velocity_y, -1000), set(clixx.velocity_x, 800)]),
			),
			
		[clear, schedule(75, clear)] where clear = set(level.player.control_lock, null), #We might get locked from the scheduled lock above, so let's make *sure*...#
		set(level.zoom, 1),
		set(level.dimensions, [2843,yval,3849,yval+level.camera_position[2]/1.5]) where yval = -10,
		schedule(1#50#, [
			music('neoBoss.ogg'),
			remove_object(clixx),
			map(range(size(sequence)), 'shot_num', schedule(sum(transform(sequence[0:shot_num+1], v.start)), sequence[shot_num].event())), #run through the attack patterns#
			]),
		] where clixx = get_object(level, 'clixx')
		where frogatto = level.player
		where plant = self
		where sequence = [
			{'start' ->  100, 'event' -> chasing_sine_wave},
			{'start' ->  20, 'event' -> bombard_push},
			{'start' ->  650, 'event' -> chasing_sine_wave},
			{'start' ->  950, 'event' -> bombard_push},
			{'start' ->  60, 'event' -> bombard_pull},
			{'start' ->  150, 'event' -> win},
			]
			
		where print = def() [debug('oh hai thar')]
		
		where win = def() die()
		
		where chasing_sine_wave = (def() ([ 										#start the emitters#
			set(pb_a.velocity_x, 300*facing),
			set(pb_a.velocity_y, 400*facing),
			add_object(pb_a),
			schedule(time_offset_for_second_polen_ball, [
				set(pb_b.velocity_x, 300*facing),
				set(pb_b.velocity_y, 400*facing),
				add_object(pb_b),
				debug(sinlist),
				]),
			schedule(650, transform([pb_a, pb_b], set(v.vars.stop_emit, 1))), 	#stop the emitters#
			]) where pb_a = object(	'pollen_ball_attack_sine', 
									midpoint_x+20*facing, 
									midpoint_y-12, facing, 
									{	'dest' -> dest_a, 
										'start' -> 100,
										'speed' -> 2.8,
										'spawn' -> 'pollen_ball_generic_nocollide',
										'spawn_rate' -> 10,
										'y_sched' -> transform(sinlist, dest_a[1]+v+amplitude/2),
										})
			where pb_b = object('pollen_ball_attack_sine', 
								midpoint_x+20*facing, 
								midpoint_y-12, facing, 
								{	'dest' -> dest_b, 
									'start' -> 100-time_offset_for_second_polen_ball,
									'speed' -> 3.5,
									'spawn' -> 'pollen_ball_generic_nocollide',
									'spawn_rate' -> 10,
									'y_sched' -> transform(sinlist[frequency/2+time_offset_for_second_polen_ball:frequency] + sinlist[0:frequency/2+time_offset_for_second_polen_ball], dest_a[1]+v+amplitude/2),
									})
			where sinlist = transform(range(frequency), sin(v*(360/frequency))*amplitude)
			where amplitude = 180
			where frequency = 180
			where dest_a = [self.midpoint_x, self.midpoint_y-250]
			where dest_b = [self.midpoint_x, self.midpoint_y+150]
			where time_offset_for_second_polen_ball = 10 #keep less than half frequency value#)
			
		where bombard_push = def() bombard(0)
		where bombard_pull = def() bombard(1)
		where bombard = def(reverse) #-1 = push, 1 = pull#
			transform(range(27), schedule(v*if(reverse, 5, 1), [
				set(obj.midpoint_x, init[0]),
				set(obj.midpoint_y, init[1]),
				set(obj.velocity_x, vel[0]),
				set(obj.velocity_y, vel[1]),
				set(obj.accel_y, 25),
				add_object(obj)]
				where obj = object('pollen_ball_generic')
				where vel = orbit(0,0,-135, if(reverse,	((27-v)+3)*40+400,
														(v+3)*40+100))
				where init = orbit(midpoint_x,midpoint_y,-135,50)
				))
		)",
